// frontend/src/pages/MyVideosPage.js
import React from 'react';

const MyVideosPage = () => {
    return (
        <div className="page-content">
            <h2>Mis Videos</h2>
            <p>Aquí verás los videos que has subido.</p>
        </div>
    );
};

export default MyVideosPage;
